import { BrowserModule } from '@angular/platform-browser';
import { NgModule } from '@angular/core';
import { HttpClientModule } from '@angular/common/http';
import { RouterModule } from '@angular/router';

import { AppComponent } from './app.component';
import { FooterMenuComponent } from './footer-menu/footer-menu.component';
import { NavMenuComponent } from './nav-menu/nav-menu.component';

import { FleetModule } from './fleet/fleet.module';
import { HomeModule } from './home/home.module';
import { NewCarModule } from './new-car/new-car.module';


@NgModule({
  declarations: [
    AppComponent,
    FooterMenuComponent,
    NavMenuComponent,
  ],
  imports: [
    BrowserModule.withServerTransition({ appId: 'ng-cli-universal' }),
    HttpClientModule,
    FleetModule,
    HomeModule,
    NewCarModule,
    RouterModule.forRoot([
      { path: '', component: HomeModule, pathMatch: 'full' },
      { path: 'fleet', component: FleetModule, pathMatch: 'full' },
      { path: 'new-car', component: NewCarModule, pathMatch: 'full' },
    ])
  ],
  providers: [],
  bootstrap: [AppComponent, FooterMenuComponent, NavMenuComponent]
})
export class AppModule { }
